import React from 'react';
import {
    Container,
    FormContainer,
    Title,
    InputLabel,
    Input,
} from '../styles/LoginStyles';

export default function Login() {
    return (
        <Container>
            <FormContainer>
                <Title>Login</Title>
                <InputComponent name={'correo'} placeholder='hola' type='email'/>
                {/* <InputComponent name='correo' /> */}
            </FormContainer>
        </Container>
    );
}

function InputComponent({
    name,
    placeholder,
    type,
}: {
    name: string;
    placeholder: string;
    type: 'email' | 'name' | 'number';
}) {
    return (
        <>
            <InputLabel>{name}</InputLabel>
            <Input
                type={type}
                placeholder='Enter your email'
            />
        </>
    );
}
